import React, { useState, useEffect } from "react";

function Resultpage(props) {
  let score = props.location.state.score;
  const ans = props.location.state.ans;
  const res = props.location.state.res;
  let passingmarks = 1;
  const [mqtopass, setMqtopass] = useState([]);

  useEffect(() => {
    fetch("http://127.0.0.1:3000/instructions")
      .then((res) => res.json())
      .then((results) => {
        setMqtopass(results);
      });
  }, []);
  let len = mqtopass.length;
  if (len != 0) {
    passingmarks = mqtopass[0].mqtopass;
  }
  if (ans === res) {
    score = score + 1;
  }
  return (
    <div className="container">
      <div className="box1">
        <h1>Your Score : {score}</h1>
        {score > { passingmarks } ? <h1>Passed</h1> : <h1>Fail</h1>}
      </div>
    </div>
  );
}

export default Resultpage;
